import React from "react";
import { NavLink } from "react-router-dom";

const Navigationmember = () => {
  return (
    <div className="navigation">
      <ul>
        <NavLink
          to="/presentationmember"
          className={(nav) => (nav.isActive ? "nav-active" : "")}
        >
          <li> Pr√©sentation </li>
        </NavLink>

        <NavLink
          to="/goodiesmember"
          className={(nav) => (nav.isActive ? "nav-active" : "")}
        >
          <li> Goodies </li>
        </NavLink>
        <NavLink
          to="/loginout"
          className={(nav) => (nav.isActive ? "nav-active" : "")}
        >
          <li> Log out</li>
        </NavLink>

        <NavLink
          to="/contactmember"
          className={(nav) => (nav.isActive ? "nav-active" : "")}
        >
          <li> Contacts </li>
        </NavLink>
      </ul>
    </div>
  );
};

export default Navigationmember;
